import React, {Component} from 'react';

class WorkoutContainer extends Component {
    constructor(){
        super();
        this.state = {
            workouts: [],
            workoutToEdit: {
                _id: null,
                name: '',
                intervalOne: 0,
                intervalTwo: 0,
                cycles: 0
            },
            modalShowing: false
        }
    }

    render(){
        return(
            <h1>workout container hiit</h1>
        )
    }
}


export default WorkoutContainer;
